function add(a,b){
    let sum = a+b;
    return sum;
}

function sub(a,b){
    let sum = a-b;
    return sum;
}
function mult(a,b){
    let sum = a*b;
    return sum;
}
function div(a,b){
    let sum = div.tofixed(2);
    return sum;
}

export default {add, sub , mult , div};
